func TestXByteEncode(t *testing.T) {
	type args struct {
		data []byte
	}
	tests := []struct {
		name string
		args args
		want []byte
	}{
		// TODO: Add test cases.
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := XByteEncode(tt.args.data); !reflect.DeepEqual(got, tt.want) {
				t.Errorf("XByteEncode() = %v, want %v", got, tt.want)
			}
		})
	}
}

